setTheme('sap_horizon');

const App = () => {


  return (
    <div className="App full-height">
      <ThemeProvider>
        <ShellBar
          logo={<img src="logo192.png" />}
          primaryTitle="React with UI5 Web Component with CAP API"
        ></ShellBar>
       <LoaderComponent></LoaderComponent>
       </ThemeProvider>
    </div>
  );
};

export default App;
